import React from 'react';


const UserOutput = (props) => {
    const style = {
        
            width: '60%',
            padding: '16px',
            margin: '16px',
            border: '2px solid black',
            backgroundColor: '#ccc',
            textAlign: 'center'
        
    }

    return (
        <div style={style}>
            <p> hello this is {props.username} 1st paragraph</p>
            <p> hello 2sd paragraph !! </p>
        </div>
    )
};

export default UserOutput ;
